function registeredDetails({ reg }) {
    var skill = '';
    for (let index = 0; index < reg.skills.length; index++) {
        skill = skill + ',' + reg.skills[index]
    }
    return (
        <div>
            <p>{reg.name}</p>
            <p>{reg.email}</p>
            <p>{reg.gender}</p>
            <p>{skill}</p>
        </div>
    )
  }
export default registeredDetails
